import React, { useState } from 'react';
import Styles from './Home.module.css';
import {InputGroup,FormControl} from 'react-bootstrap';
import ProfileCard from './ProfileCard/ProfileCard'
import Toolbar from '../Toolbar/Toolbar';
import axios from 'axios';
const Home = ({history})=>{
    const [imgUrl,setimgUrl] = useState('');
    axios.get('https://pixabay.com/api/?key=16381049-c197cfa5caeabac8c93d8da2c&q=red+cars&image_type=photo')
    .then(response =>{
       
        const imgs=  response.data.hits[0];
        console.log(imgs);
        setimgUrl(imgs.largeImageURL);
    })
    .catch(err =>{
        console.log(err);
    })
    return (
        <div className = {Styles.container}>
            <img src = {imgs.largeImageURL}></img>
        </div>        

    )
}
export default Home;
